import React from 'react'
import './drop-down.styles.scss'

import useFetch from '../../effects/use-fetch.effect';


function selectedSubjectName() {
    var subjectIdNode = document.getElementById('asset-list');
    var value =
    subjectIdNode.options.outerText;
    console.log(value );
}



const AssetDropDown =() => {

useFetch(`http://localhost:3000/allunits`, 'asset-list');

    return(
        <div className='combo-box-container'  >
        
            <input  
                className = 'combo-box'
                type="text" 
                list="asset-list"
                />
            <select id="asset-list" >
            </select>
            <button onClick={() => {selectedSubjectName()} }> Click me for all tests</button>
        </div>
    )
}

export default AssetDropDown;
